        public static void SetData(LongListSelector control, IList<Bus> source)
        {
            var byCategory = from Bus in source
                             group Bus by Bus.Category into c
                             //orderby c.Key
                             select new PublicGrouping<string, Bus>(c);

            control.ItemsSource = byCategory;
        }

        public static IList<Bus> LoadBusesIUrb()
        {
            return Repository.Where(x => "I".Equals(x.Tipo)).ToList();
        }

        public static IList<Bus> LoadBusesProv()
        {
            return Repository.Where(x => "P".Equals(x.Tipo)).ToList();
        }

        public static IList<Bus> LoadBusesMuni()
        {
            return Repository.Where(x => "M".Equals(x.Tipo)).ToList();
        }

        public static string ByCode(string code)
        {
            var firstOrDefault = Repository.FirstOrDefault(x => x.Title.Contains(" " + code));
            return firstOrDefault != null ? firstOrDefault.Description : string.Empty;
        }
    }
